/** @format */

import { Typography, Box, FormLabel, MenuItem, TextField } from "@mui/material";
import React, { Fragment } from "react";
import MatterList from "./components/MatterList";

const MatterDashboard = () => {
  return (
    <Fragment>
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          "& > :not(style)": { m: 1 },
        }}
      >
        <MatterList />
      </Box>
    </Fragment>
  );
};

export default MatterDashboard;
